        return new Source("{% extends 'backoffice.html.twig' %}





{% block body  %}

    <h1>Liste des produits</h1>

    <table class=\"table table dark table-striped\">
        <thead>
            <tr>
                <th>Nom</th>
                <th>Prix</th>
                <th>Photo</th>
                <th>Actions</th>
            </tr>
        </thead>

        <tbody>

        {% for product in products %}
        <tr>
            <td>{{ product.title }}</td>
            <td>{{ product.price }}</td>
            <td><img src=\"{{ asset('upload/' ~ product.picture) }}\" width=\"80\" alt=\"\"></td>
            <td>
                <a href=\"{{ path('editProduct', {'id': product.id }) }}\" class=\"mr-2\" ><i class=\"fas fa-2x fa-edit \"></i></a>
                <a href=\"{{ path('deleteProduct', {'id': product.id }) }}\" class=\"ml-2 text-warning\" ><i class=\"fas fa-2x fa-trash\"></i></a>
            </td>
        </tr>
        {% endfor %}
        </tbody>




    </table>



{% endblock %}




{% block title  %}
parent()
{% endblock %}", "product/listProduct.html.twig", "C:\\Users\\Ionel\\Desktop\\Symphony_cours\\blog\\templates\\product\\listProduct.html.twig");
